import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <img src="public/pigeon-logo.png" />
            <h1>Web Pigeon</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/create" >Create Messenger</Link>
            </div>
        </nav>
    );
}
 
export default Navbar;
